import logo from './logo.svg';
import './App.css';
import store from './redux/Store'
import Post from './components/posts'
import { Provider } from 'react-redux'
import signUp from './components/signUp'



function App() {
  return (
    <Provider store={store}>
   
      {/* <Post></Post> */}
      <signUp></signUp>
    </Provider>
  );
}

export default App;
